import { Route } from 'react-router-dom';
import Product from './Pages/Product';
import Welcome from './Pages/Welcome';
function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/product">
        <Product />
      </Route>
      welcome to my page!
    </div>
  );
}

export default App;



